<template>
  <div class="clothing-search-page">
    <div class="search-container">
      <input 
        type="text" 
        v-model="searchQuery" 
        @input="performSearch" 
        placeholder="Search for clothing items..." 
        class="search-bar"
      />
    </div>
    <div v-if="filteredItems.length" class="results-container">
      <div v-for="item in filteredItems" :key="item.id" class="result-item">
        <img :src="item.image_url" :alt="item.name" class="item-image">
        <div class="item-details">
          <h3 class="item-name">{{ item.name }}</h3>
          <p class="item-price">${{ item.price }}</p>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
export default {
  data() {
    return {
      searchQuery: '',
      clothingItems: [
        { id: 1, name: 'shirt', price: 199.99, image_url: 'data:image/jpeg;base64,' },
        { id: 2, name: 'Pants', price: 459.99, image_url: 'data:image/jpeg;base64,' },
        { id: 3, name: 'Dress', price: 479.99, image_url: 'data:image/jpeg;base64,' },
        { id: 4, name: 'Jacket', price: 829.99, image_url: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSgy5h5FL14m90VHbzxa0BpO-jAZwTwQZIh0Q&s' },
        { id: 5, name: 'saari', price: 890.99, image_url: 'data:image/jpeg;base64,' },
        {id:6, name:'pathani suit',price:445,img_url:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTkWxr4844twMyjZ-80Th_xjsyteDafonQJ7A&s'},
        {id:7,name:'ghagara',price:678,img_url:'data:image/jpeg;base64,'},
        {id:8,name:'panjabi suit',price:766,img_url:'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTz2QaVnte-sYpJIeigWWjBPaJfeoNM8twcrg&s'}
      ],
      filteredItems: []
    };
  },
  methods: {
    performSearch() {
      if (this.searchQuery.length > 3) {
        const query = this.searchQuery.toLowerCase();
        this.filteredItems = this.clothingItems.filter(item => 
          item.name.toLowerCase().includes(query)
        );
      } else {
        this.filteredItems = [];
      }
    }
  }
};
</script>

<style scoped>
.clothing-search-page {
  max-width: 1200px;
  margin: 20px auto;
  padding: 20px;
  background-color: #f8f9fa;
  border-radius: 8px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
}

.search-container {
  text-align: center;
  margin-bottom: 20px;
}

.search-bar {
  width: 100%;
  max-width: 500px;
  padding: 10px;
  font-size: 1rem;
  border: 1px solid #ced4da;
  border-radius: 4px;
}

.results-container {
  display: flex;
  flex-wrap: wrap;
  gap: 20px;
  justify-content: center;
}

.result-item {
  background-color: #fff;
  border: 1px solid #ddd;
  border-radius: 8px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
  overflow: hidden;
  width: calc(33.333% - 20px);
  max-width: 300px;
  text-align: center;
  transition: transform 0.3s ease;
}

.result-item:hover {
  transform: scale(1.05);
}

.item-image {
  width: 100%;
  height: auto;
  border-bottom: 1px solid #ddd;
}

.item-details {
  padding: 10px;
}

.item-name {
  font-size: 1.25rem;
  color: #343a40;
  margin: 10px 0;
}

.item-price {
  font-size: 1.5rem;
  color: #28a745;
  font-weight: bold;
}
</style>
